import React, { Component} from 'react';
import "./films.css"
import Film from '../Film/Film';

class Films extends Component {
    render(){
        return(
            <ul>
                <Film />
                <Film />
                <Film />
                <Film />
            </ul>
        )
    }
}

export default Films;
